const Card = () => {
  return (
    <div className="w-[154px] h-[342px]">
      <div className="relative">
        <img
          src="data:image/jpeg;base64,"
          alt="harry_potter"
          className="h-[255px] rounded-[8px]"
        />
        <div className="absolute bg-[#ef7f1a] w-10 h-10 rounded-full flex items-center justify-center bottom-3 right-5 cursor-pointer">
          <img src="/icons/bag.svg" alt="bag" />
        </div>
      </div>
      <div className="mt-[10px]">
        <h3 className="text-basefont-bold">Venetsiya missiyasi</h3>
        <p className="text-[#828282] text-sm">Jeyms Hedli Cheyz</p>
        <h3 className="text-[#ef7f1a] text-base font-bold">38 000 so'm</h3>
      </div>
    </div>
  );
};

